/*

CS535
Project #6
Gregory Nothnagel

Description:

	Since the viewer's position can be fixed, just have a rotation matrix in the vertex shader to rotate the scene so that all walls can be seen.

	Handling the different textures was the hardest part, in the end I decided to bundle all material textures into one texture.png file.

	THIS "texture.png" FILE DOES NOT AFFECT THE RENDER AND IS FOR REFERENCE ONLY!
	This is because the global image1_raw variable is hard coded with the RGB image data from texture.png

	I manipulate the TV frames by changing the texture coordinates used for the TV vertices, like a film reel
	
	
	Now for project 6, I enable and disable blending at the appropriate times to add a translucent cup.
	The back of the cup is drawn first, then the blue sphere is added with the fragment shader (which was easier than making a cube-subdividing algorithm), then the front of the cup.
	Two buttons for adding and removing the sphere swap visibilities when the other is clicked.
	
*/


